INSERT INTO `sys_oper_log` VALUES (392, '新增入库', 1, 'com.gzzj.expert.controller.EdExpertStorageApplicationController.add()', 'POST', 1, 'admin', '专家组', '/expert/storageApplication', '127.0.0.1', '内网IP', '{\"applicationDate\":\"2024-07-09 10:04\",\"createTime\":\"2024-07-09 10:04:24\",\"edExpertStorageApplicationAttachList\":[{\"attachName\":\"一种基于项目管理模式的体系建设方法实践_张小旗.pdf\",\"attachType\":\"application/pdf\",\"attachUrl\":\"/profile/upload/2024/07/09/一种基于项目管理模式的体系建设方法实践_张小旗_20240709100351A002.pdf\",\"createTime\":\"2024-07-09 10:04:24\",\"params\":{},\"storageApplicationId\":17}],\"edExpertStorageApplicationId\":17,\"expertInfo\":{\"applicationId\":17,\"awards\":\"1\",\"birthDate\":\"2024-07-09\",\"communicationAddress\":\"东澳创意小镇\",\"createTime\":\"2024-07-09 10:04:24\",\"currentMajor\":\"开发\",\"delFlag\":\"0\",\"edExpertInfoId\":18,\"edTechnicalFieldsList\":[{\"edExpertInfoId\":18,\"firstLevel\":\"电子信息\",\"params\":{},\"secondLevel\":\"计算机与网络\",\"thirdLevel\":\"计算机网络技术\"},{\"edExpertInfoId\":18,\"firstLevel\":\"生物医药\",\"params\":{},\"secondLevel\":\"生物技术\",\"thirdLevel\":\"基因工程与疫苗\"},{\"edExpertInfoId\":18,\"firstLevel\":\"新能源与高效节能\",\"params\":{},\"secondLevel\":\"智能电网\",\"thirdLevel\":\"智能调节技术\"},{\"edExpertInfoId\":18,\"firstLevel\":\"装备制造\",\"params\":{},\"secondLevel\":\"轨道交通\",\"thirdLevel\":\"轨道车辆控制系统\"}],\"edWorkExperienceList\":[{\"edExpertInfoId\":18,\"fieldWorked\":\"开发\",\"organization\":\"智教\",\"params\":{},\"positionHeld\":\"前端\",\"timePeriod\":\"2024-07-09\"},{\"edExpertInfoId\":18,\"params\":{}},{\"edExpertInfoId\":18,\"params\":{}},{\"edExpertInfoId\":18,\"params\":{}}],\"email\":\"fjielin@163.com\",\"enjoysSpecialAllowance\":\"省级\",\"expertiseInScienceEducation\":\"我的专长学科和领域主要包括自然语言处理(NLP)、‌数据处理与分析、‌机器学习、‌计算机视觉、‌以及自动化。‌\\n\\n自然语言处理(NLP)：‌作为人工智能的一个分支，‌我擅长理解和生成自然语言，‌涉及语音识别、‌语义分析、‌知识图谱等方面。‌我能够快速分析大量语言数据，‌进行统计分析和语言模型转换，‌以及语法和语义分析。‌此外，‌我还能根据上下文和语气调整回答，‌使语言更加自然流畅，‌在对话机器人、‌智能客服、‌语音助手等领域有广泛应用。‌\\n\\n数据处理与分析：‌我能够处理大量数据集，‌发现数据背后的规律和趋势。‌通过机器学习对数据进行分类、‌预测和分析，‌帮助人们更好地理解和利用数据。‌\\n机器学习、‌计算机视觉、‌自动化：‌在这些领域，‌我能够提供帮助和支持，‌解决各种挑战和问题，‌提高生产力和效率。‌虽然我是一名AI语言模型，‌但我的知识和技能不仅限于这些领域，‌我还在不断学习和进步中，‌以期为人类带来更多的帮助和便利。‌\",\"firstDegree\":\"无\",\"firstEducation\":\"小学\",\"firstGraduatedSchool\":\"南山幼儿园\",\"firstMajor\":\"无\",\"highestDegree\":\"学士学位\",\"highestEducation\":\"本科\",\"highestGraduatedSchool\":\"天河大学\",\"highestMajor\":\"计算机科学与技术\",\"idNumber\":\"441781199612155450\",\"intellectualProp', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-09 10:04:24', 193);
