rstDegree\":\"无\",\"firstEducation\":\"小学\",\"firstGraduatedSchool\":\"南山幼儿园\",\"firstMajor\":\"无\",\"highestDegree\":\"学士学位\",\"highestEducation\":\"本科\",\"highestGraduatedSchool\":\"天河大学\",\"highestMajor\":\"计算机科学与技术\",\"idNumber\":\"441781199612155450\",\"intellectualProperty\":\"2\",\"isAcademician\":0,\"isPhdSupervisor\":0,\"mobile\":\"13727234324\",\"name\":\"冯杰林\",\"officePhone\":\"13727234324\",\"params\":{},\"photoUr', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-12 15:02:21', 187);
