INSERT INTO `sys_oper_log` VALUES (823, '专家信息', 2, 'com.gzzj.expert.controller.EdExpertInfoController.edit()', 'PUT', 1, 'admin', '专家组', '/expertData/expert/expertInfo', '127.0.0.1', '内网IP', '{\"age\":26,\"applicationId\":42,\"awards\":\"一、获奖概览\\n\\n本报告汇总了近年来在科技教育领域取得显著成就的个人和团队所获得的奖项。这些奖项体现了教育工作者、研究人员以及教育机构在推动科技教育创新、提升科学素养、促进学术交流等方面的重要贡献。\\n\\n二、个人奖项\\n\\n科技教育创新奖\\n\\n获奖者：张华教授\\n颁奖机构：国家教育部\\n获奖时间：2023年5月\\n获奖理由：张华教授在中小学科技教育课程改革中做出了突出贡献，其研发的STEM课程体系在全国范围内得到推广应用。\\n杰出科技教育工作者奖\\n\\n获奖者：李娜博士\\n颁奖机构：中国科学技术协会\\n获奖时间：2023年10月\\n获奖理由：李娜博士长期致力于青少年科学素养提升工作，其主导的科普项目深受学生喜爱，有效激发了学生的科学兴趣。\\n三、团队奖项\\n\\n科技教育杰出团队奖\\n获奖团队：未来教育技术研究小组\\n颁奖机构：国家科技部\\n获奖时间：2023年7月\\n获奖理由：该团队在教育技术集成研究方面取得突破性进展，开发的智能教学辅助系统极大提高了教学效率和质量。\",\"birthDate\":\"1997-11-12\",\"communicationAddress\":\"广州天河区华南植物园\",\"createBy\":\"\",\"createTime\":\"2024-07-16 10:16:53\",\"curYearNum\":0,\"currentMajor\":\"研究员\",\"delFlag\":\"0\",\"edExpertInfoId\":41,\"edTechnicalFieldsList\":[{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"id\":254,\"params\":{},\"secondLevel\":\"环保\",\"thirdLevel\":\"固碳植物\"},{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"id\":255,\"params\":{}},{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"id\":256,\"params\":{},\"secondLevel\":\"生态环保\",\"thirdLevel\":\"环保科学\"},{\"edExpertInfoId\":41,\"firstLevel\":\"\",\"id\":257,\"params\":{}}],\"edWorkExperienceList\":[{\"edExpertInfoId\":41,\"fieldWorked\":\"行政\",\"id\":250,\"organization\":\"地球村\",\"params\":{},\"positionHeld\":\"执事长\",\"timePeriod\":\"2021-01,2022-07\"},{\"edExpertInfoId\":41,\"fieldWorked\":\"植物学碳吸收研究\",\"id\":251,\"organization\":\"华南植物园\",\"params\":{},\"positionHeld\":\"研究员\",\"timePeriod\":\"2024-09,2025-12\"},{\"edExpertInfoId\":41,\"fieldWorked\":\"44444444444444444444445555555555555555555666666666\",\"id\":252,\"organization\":\"hhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhh\",\"params\":{},\"positionHeld\":\"11111111111111222222222222222222222233333333333333\",\"timePeriod\":\"2025-05,2025-06\"},{\"edExpertInfoId\":41,\"id\":253,\"params\":{}}],\"email\":\"hh@163.com\",\"enjoysSpecialAllowance\":\"无\",\"expertCategory\":\"T02\",\"expertLabel\":\"评审咨询\",\"expertiseInScienceEducation\":\"植物学：研究植物的结构、功能、分类、分布和演化。\\n生态学：研究生物与其环境之间的相互作用，包括植物在生态系统中的作用。\\n生物化学：研究生物体内的化学过程，特别是植物如何进行光合作用固碳。\\n环境科学：研究自然环境和人类活动对环境的影响，植物固碳是减少温室气体排放的重要途径。\\n土壤学：研究土壤的结构、组成、性质和肥力，土壤是植物生长的基础，影响植物固碳能力。\\n气象学：研究气候和天气模式，这些因素影响植物的生长和固碳效率。\\n农业科学：研究作物生产和农业生态系统，提高作物', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-16 14:18:48', 15);
INSERT INTO `sys_oper_log` VALUES (824, '专家信息', 2, 'com.gzzj.expert.controller.EdExpertInfoController.edit()', 'PUT', 1, '1101', '专家库', '/expert/expertInfo', '127.0.0.1', '内网IP', '{\"age\":27,\"applicationId\":17,\"awards\":\"1\",\"birthDate\":\"2024-07-09\",\"communicationAddress\":\"东澳创意小镇\",\"createBy\":\"\",\"createTime\":\"2024-07-15 15:33:54\",\"curYearNum\":0,\"currentMajor\":\"开发\",\"delFlag\":\"0\",\"edExpertInfoId\":18,\"edTechnicalFieldsList\":[{\"edExpertInfoId\":18,\"firstLevel\":\"电子信息\",\"id\":222,\"params\":{},\"secondLevel\":\"计算机与网络\",\"thirdLevel\":\"计算机网络技术\"},{\"edExpertInfoId\":18,\"firstLevel\":\"生态环境\",\"id\":223,\"params\":{},\"secondLevel\":\"生物技术\",\"thirdLevel\":\"基因工程与疫苗\"},{\"edExpertInfoId\":18,\"firstLevel\":\"新能源与高效节能\",\"id\":224,\"params\":{},\"secondLevel\":\"智能电网\",\"thirdLevel\":\"智能调节技术\"},{\"edExpertInfoId\":18,\"firstLevel\":\"装备制造\",\"id\":225,\"params\":{},\"secondLevel\":\"轨道交通\",\"thirdLevel\":\"轨道车辆控制系统\"}],\"edWorkExperienceList\":[{\"edExpertInfoId\":18,\"fieldWorked\":\"开发\",\"id\":218,\"organization\":\"智教\",\"params\":{},\"positionHeld\":\"前端\",\"timePeriod\":\"2024-07-16,2024-07-18\"},{\"edExpertInfoId\":18,\"id\":219,\"params\":{},\"timePeriod\":\"2024-07-09,2024-07-19\"},{\"edExpertInfoId\":18,\"id\":220,\"params\":{},\"timePeriod\":\"2024-07-02,2024-08-24\"},{\"edExpertInfoId\":18,\"id\":221,\"params\":{},\"timePeriod\":\"\"}],\"email\":\"fjielin@163.com\",\"enjoysSpecialAllowance\":\"省级\",\"expertCategory\":\"T01\",\"expertLabel\":\"评审咨询,授课培训类,指导评估类,科学副校长类\",\"expertiseInScienceEducation\":\"我的专长学科和领域主要包括自然语言处理(NLP)、‌数据处理与分析、‌机器学习、‌计算机视觉、‌以及自动化。‌\\n\\n自然语言处理(NLP)：‌作为人工智能的一个分支，‌我擅长理解和生成自然语言，‌涉及语音识别、‌语义分析、‌知识图谱等方面。‌我能够快速分析大量语言数据，‌进行统计分析和语言模型转换，‌以及语法和语义分析。‌此外，‌我还能根据上下文和语气调整回答，‌使语言更加自然流畅，‌在对话机器人、‌智能客服、‌语音助手等领域有广泛应用。‌\\n\\n数据处理与分析：‌我能够处理大量数据集，‌发现数据背后的规律和趋势。‌通过机器学习对数据进行分类、‌预测和分析，‌帮助人们更好地理解和利用数据。‌\\n机器学习、‌计算机视觉、‌自动化：‌在这些领域，‌我能够提供帮助和支持，‌解决各种挑战和问题，‌提高生产力和效率。‌虽然我是一名AI语言模型，‌但我的知识和技能不仅限于这些领域，‌我还在不断学习和进步中，‌以期为人类带来更多的帮助和便利。‌\",\"firstDegree\":\"无\",\"firstEducation\":\"小学\",\"firstGraduatedSchool\":\"南山幼儿园\",\"firstMajor\":\"无\",\"highestDegree\":\"学士学位\",\"highestEducation\":\"本科\",\"highestGraduatedSchool\":\"天河大学\",\"highestMajor\":\"计算机科学与技术\",\"idNumber\":\"441781199612155450\",\"intellectualProperty\":\"2\",\"isAcademician\":0,\"isPhdSupervisor\":0,\"mobile\":\"13727234324\",\"name\":\"冯杰林\",\"officePhone\":\"13727234324\",\"params\":{},', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-16 14:23:58', 235);
