\n开发时间：2021年\\n技术概述：设计一种搭载高灵敏度传感器的无人机，用于实时监测空气质量和水质状况。\\n应用场景：广泛应用于环境监管部门，为环境决策提供数据支持。\\n知识产权情况\\n专利名称：一种智能垃圾分类方法及系统\\n\\n专利号：CN202310000001.X\\n申请时间：2023年1月\\n专利概述：涵盖了智能垃圾分类系统的核心算法和硬件设计。\\n专利名称：可持续能源智能管理方法及系统\\n\\n专利号：CN202210000002.9\\n申请时间：2022年3月\\n专利概述：包括能源收集、存储和智能分配的专利技术。\\n专利名称：环境监测无人机及其数\",\"isAcademician\":1,\"isPhdSupervisor\":1,\"mobile\":\"13765152233\",\"name\":\"美君\",\"officePhone\":\"\",\"params\":{},\"photoUrl\":\"da', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-16 16:50:18', 5);
