ajor\":\"计算机科学与技术\",\"idNumber\":\"441781199612155450\",\"intellectualProperty\":\"2\",\"isAcademician\":0,\"isPhdSupervisor\":0,\"mobile\":\"13727234324\",\"name\":\"冯杰林\",\"officePhone\":\"13727234324\",\"params\":{},\"photoUrl\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAMgAAADICAYAAACtWK6eAAAAAXNSR0IArs4c6QAAIABJREFUeF6svQeUZOd1HvhV6EpdnXPunu6enu7JM5iIAQaRSEQgGEBKlkRKoiRLVFiJCpZk6xzrWN61V5K9ssKRtLaoNS0zgAADCBAZM8AAg8', '{\"msg\":\"审核成功\",\"code\":200}', 0, NULL, '2024-07-16 17:09:55', 125);
