INSERT INTO `sys_oper_log` VALUES (924, '审核信息变更信息', 2, 'com.gzzj.expert.controller.EdExpertInfoChangeController.verify()', 'POST', 1, '1101', '专家库', '/expert/expertChange/verify', '127.0.0.1', '内网IP', '{\"age\":28,\"awards\":\"1、\\n奖项名称：国家教育创新奖\\n颁发机构：国家教育部\\n获奖项目：基于人工智能的个性化学习平台开发\\n获奖时间：2023年11月\\n获奖理由：该项目在推动教育个性化和智能化方面取得了显著成就，有效提升了学习效率和质量。\\n2、\\n奖项名称：省级优秀教育科研成果奖\\n颁发机构：XX省教育厅\\n获奖项目：STEM教育在中学阶段的实践与评估\\n获奖时间：2022年9月\\n获奖理由：该项目对STEM教育模式进行了深入研究和实践，为提高学生的综合素质和创新能力做出了重要贡献。\\n\",\"birthDate\":\"1996-07-01\",\"communicationAddress\":\"中国北京市海淀区中关村软件园东区5号楼\",\"createBy\":\"\",\"createTime\":\"2024-07-11 15:18:26\",\"currentMajor\":\"生物技术\",\"delFlag\":\"0\",\"edExpertInfoChangeId\":19,\"edExpertInfoId\":29,\"edTechnicalFieldsList\":[{\"firstLevel\":\"生物科学\",\"id\":150,\"params\":{},\"secondLevel\":\"生物技术\",\"thirdLevel\":\"农业生物技术\"},{\"firstLevel\":\"生物科学\",\"id\":151,\"params\":{},\"secondLevel\":\"生物技术\",\"thirdLevel\":\"生物制药\"},{\"firstLevel\":\"数据分析\",\"id\":152,\"params\":{},\"secondLevel\":\"数据科学\",\"thirdLevel\":\"机器学习\"},{\"id\":153,\"params\":{}}],\"edWorkExperienceList\":[{\"fieldWorked\":\"数学\",\"id\":146,\"organization\":\"新华中学\",\"params\":{},\"positionHeld\":\"数学教师\",\"timePeriod\":\"2016-08-08\"},{\"id\":147,\"params\":{}},{\"id\":148,\"params\":{}},{\"id\":149,\"params\":{}}],\"email\":\"fjielin@163.com\",\"enjoysSpecialAllowance\":\"省级\",\"expertCategory\":\"T02\",\"expertiseInScienceEducation\":\"数据科学、有机化学、无机化学、生物化学\",\"firstDegree\":\"理学学士（BS）\",\"firstEducation\":\"本科\",\"firstGraduatedSchool\":\"清华大学\",\"firstMajor\":\"生物技术\",\"highestDegree\":\"哲学博士（Ph.D）\",\"highestEducation\":\"博士\",\"highestGraduatedSchool\":\"哈佛大学\",\"highestMajor\":\"物理学\",\"idNumber\":\"511322199607010560\",\"intellectualProperty\":\"环保科技情况\\n\\n项目名称：智能垃圾分类系统\\n开发时间：2023年\\n技术概述：利用图像识别和机器学习技术，开发一套能够自动识别并分类垃圾的智能系统。\\n应用场景：已在多个城市社区和商业中心进行试点，提高了垃圾分类的效率和准确率。\\n\\n项目名称：可持续能源管理系统\\n开发时间：2022年\\n技术概述：开发一套集成太阳能、风能等多种可再生能源的智能管理系统，优化能源分配和使用。\\n应用场景：在工业园区和大型商业建筑中实施，有效降低了能源消耗和碳排放。\\n项目名称：环境监测无人机\\n\\n开发时间：2021年\\n技术概述：设计一种搭载高灵敏度传感器的无人机，用于实时监测空气质量和水质状况。\\n应用场景：广泛应用于环境监管部门，为环境决策提供数据支持。\\n知识产权情况\\n专利名称：一种智能垃圾分类方法及系统\\n\\n专利号：CN202310000001.X\\n申请时间：2023年1月\\n专利概述：涵盖了智能垃圾分类系统的核心算法和硬件设计。\\n专利名称：可持续能源智能管理方法及系统\\n\\n专利号：CN202210000002.9\\n申请时间：2022年3月\\n专利概述：包括能源收集、存储和智能分配的专利技术。\\n专利名称：环境监测无人机及其数\",\"isAcademician\":1,\"isPhdSupervisor\":1,\"mobile\":\"13765152233\",\"name\":\"美君\",\"officePhone\":\"\",\"params\":{},\"photoUr', '{\"msg\":\"审核成功\",\"code\":200}', 0, NULL, '2024-07-16 17:12:35', 57);
