INSERT INTO `sys_oper_log` VALUES (932, '审核信息变更信息', 2, 'com.gzzj.expert.controller.EdExpertInfoChangeController.verify()', 'POST', 1, '1101', '专家库', '/expertData/expert/expertChange/verify', '127.0.0.1', '内网IP', '{\"age\":26,\"awards\":\"一、获奖概览\\n\\n本报告汇总了近年来在科技教育领域取得显著成就的个人和团队所获得的奖项。这些奖项体现了教育工作者、研究人员以及教育机构在推动科技教育创新、提升科学素养、促进学术交流等方面的重要贡献。\\n\\n二、个人奖项\\n\\n科技教育创新奖\\n\\n获奖者：张华教授\\n颁奖机构：国家教育部\\n获奖时间：2023年5月\\n获奖理由：张华教授在中小学科技教育课程改革中做出了突出贡献，其研发的STEM课程体系在全国范围内得到推广应用。\\n杰出科技教育工作者奖\\n\\n获奖者：李娜博士\\n颁奖机构：中国科学技术协会\\n获奖时间：2023年10月\\n获奖理由：李娜博士长期致力于青少年科学素养提升工作，其主导的科普项目深受学生喜爱，有效激发了学生的科学兴趣。\\n三、团队奖项\\n\\n科技教育杰出团队奖\\n获奖团队：未来教育技术研究小组\\n颁奖机构：国家科技部\\n获奖时间：2023年7月\\n获奖理由：该团队在教育技术集成研究方面取得突破性进展，开发的智能教学辅助系统极大提高了教学效率和质量。\",\"birthDate\":\"1997-11-12\",\"communicationAddress\":\"广州天河区华南植物园\",\"createBy\":\"\",\"createTime\":\"2024-07-16 17:30:18\",\"currentMajor\":\"研究员\",\"delFlag\":\"0\",\"edExpertInfoChangeId\":31,\"edExpertInfoId\":41,\"edTechnicalFieldsList\":[{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"params\":{},\"secondLevel\":\"环保\",\"thirdLevel\":\"固碳植物\"},{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"params\":{}},{\"edExpertInfoId\":41,\"firstLevel\":\"生物\",\"params\":{},\"secondLevel\":\"生态环保\",\"thirdLevel\":\"环保科学\"},{\"edExpertInfoId\":41,\"firstLevel\":\"\",\"params\":{}}],\"edWorkExperienceList\":[{\"edExpertInfoId\":41,\"fieldWorked\":\"行政\",\"organization\":\"地球村\",\"params\":{},\"positionHeld\":\"执事长\",\"timePeriod\":\"2021-01,2022-07\"},{\"edExpertInfoId\":41,\"fieldWorked\":\"植物学碳吸收研究\",\"organization\":\"华南植物园\",\"params\":{},\"positionHeld\":\"研究员\",\"timePeriod\":\"2024-09,2025-12\"},{\"edExpertInfoId\":41,\"fieldWorked\":\"44444444444444444444445555555555555555555666678878\",\"organization\":\"hhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhhh\",\"params\":{},\"positionHeld\":\"11111111111111222222222222222222222233333333333333\",\"timePeriod\":\"2025-05,2025-06\"},{\"edExpertInfoId\":41,\"params\":{}}],\"email\":\"hh@163.com\",\"enjoysSpecialAllowance\":\"无\",\"expertCategory\":\"T02\",\"expertiseInScienceEducation\":\"植物学：研究植物的结构、功能、分类、分布和演化。\\n生态学：研究生物与其环境之间的相互作用，包括植物在生态系统中的作用。\\n生物化学：研究生物体内的化学过程，特别是植物如何进行光合作用固碳。\\n环境科学：研究自然环境和人类活动对环境的影响，植物固碳是减少温室气体排放的重要途径。\\n土壤学：研究土壤的结构、组成、性质和肥力，土壤是植物生长的基础，影响植物固碳能力。\\n气象学：研究气候和天气模式，这些因素影响植物的生长和固碳效率。\\n农业科学：研究作物生产和农业生态系统，提高作物的固碳能力是农业科学的一个重要方向。\\n分子生物学：研究生物分子的结构和功能，包括植物固碳过程中的基因表达和调控。\\n遗传学：研究遗传变异和遗传机制，通过遗传改良提高植物的固碳能力。\\n地理信息系统（G', '{\"msg\":\"审核成功\",\"code\":200}', 0, NULL, '2024-07-16 17:31:18', 22);
