1278561\",\"intellectualProperty\":\"环保科技领域获奖情况：\\n\\n奖项名称：中华环保联合会杰出青年科技奖\\n获奖时间：2023年\\n获奖原因：王强教授在有机废弃物资源化转化技术、可再生能源利用与可持续发展领域的研究工作，对生态环境保护技术推广、生态环境保护观念形成发挥重要作用，其学术成果已被本行业认可，获得良好的社会效益和经济效益 。\\n\\n奖项名称：环境保护科学技术奖一等奖\\n获奖时间：2023年\\n获奖项目：“有色金属采选冶废渣场污染源头综合防控与生态修复关键技术及应用”\\n获奖原因：该项目在环境科学技术上有重大创新，技术难度大，总体技术水平、主要技术经济指标达到国际先进水平，得到广泛应用，取得重大环境效益，对推动经济发展和社会进步有重大意义和作用 。\",\"isAcademician\":0,\"isPhdSupervisor\":0,\"mobile\":\"13512345676\",', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-17 09:17:42', 86);
