INSERT INTO `sys_oper_log` VALUES (1000, '专家信息', 2, 'com.gzzj.expert.controller.EdExpertInfoController.edit()', 'PUT', 1, 'admin', '专家组', '/expert/expertInfo', '127.0.0.1', '内网IP', '{\"age\":47,\"applicationId\":35,\"awards\":\"项目名称：基于人工智能的个性化教育平台开发\\n\\n项目来源：国家教育部\\n立项时间：2021年1月\\n本人承担的工作：项目负责人，主导研究和开发工作\\n项目名称：跨学科STEM教育模式创新研究\\n\\n项目来源：省级教育科学规划领导小组\\n立项时间：2019年9月\\n本人承担的工作：研究团队核心成员，负责课程设计和教学方法研究\",\"birthDate\":\"1976-11-27\",\"communicationAddress\":\"211\",\"createBy\":\"\",\"createTime\":\"2024-07-17 11:30:02\",\"curYearNum\":0,\"currentMajor\":\"计算机科学\",\"delFlag\":\"0\",\"edExpertInfoId\":34,\"edTechnicalFieldsList\":[{\"edExpertInfoId\":34,\"firstLevel\":\"人工智能\",\"id\":366,\"params\":{},\"secondLevel\":\"人工智能1\",\"thirdLevel\":\"人工智能2\"},{\"edExpertInfoId\":34,\"firstLevel\":\"机器学习\",\"id\":367,\"params\":{},\"secondLevel\":\"机器学习1\",\"thirdLevel\":\"机器学习2\"},{\"edExpertInfoId\":34,\"firstLevel\":\"数据挖掘\",\"id\":368,\"params\":{},\"secondLevel\":\"数据挖掘1\",\"thirdLevel\":\"数据挖掘2\"},{\"edExpertInfoId\":34,\"id\":369,\"params\":{}}],\"edWorkExperienceList\":[{\"edExpertInfoId\":34,\"fieldWorked\":\"深度学习与模式识别\",\"id\":362,\"organization\":\"中国科学院自动化研究所\",\"params\":{},\"positionHeld\":\"研究员\",\"timePeriod\":\"2015-08-01,2015-10-01\"},{\"edExpertInfoId\":34,\"fieldWorked\":\"计算机视觉与图像处理\",\"id\":363,\"organization\":\"北京科技大学计算机科学与技术学院\",\"params\":{},\"positionHeld\":\"副教授\",\"timePeriod\":\"2010-07-01,2010-07-02\"},{\"edExpertInfoId\":34,\"id\":364,\"params\":{},\"timePeriod\":\"\"},{\"edExpertInfoId\":34,\"id\":365,\"params\":{},\"timePeriod\":\"\"}],\"enjoysSpecialAllowance\":\"无\",\"expertCategory\":\"T02\",\"expertLabel\":\"评审咨询,授课培训类,指导评估类\",\"expertiseInScienceEducation\":\"人工智能与机器学习\\n\\n深度学习算法\\n强化学习\\n神经网络\\n数据科学\\n\\n大数据分析\\n数据挖掘技术\\n统计建模\\n\",\"firstDegree\":\"博士学位\",\"firstEducation\":\"博士\",\"firstGraduatedSchool\":\"北京大学\",\"firstMajor\":\"计算机科学\",\"highestDegree\":\"硕士学位\",\"highestEducation\":\"硕士\",\"highestGraduatedSchool\":\"清华大学\",\"highestMajor\":\"软件工程\",\"idNumber\":\"340102197611278561\",\"intellectualProperty\":\"环保科技领域获奖情况：\\n\\n奖项名称：中华环保联合会杰出青年科技奖\\n获奖时间：2023年\\n获奖原因：王强教授在有机废弃物资源化转化技术、可再生能源利用与可持续发展领域的研究工作，对生态环境保护技术推广、生态环境保护观念形成发挥重要作用，其学术成果已被本行业认可，获得良好的社会效益和经济效益 。\\n\\n奖项名称：环境保护科学技术奖一等奖\\n获奖时间：2023年\\n获奖项目：“有色金属采选冶废渣场污染源头综合防控与生态修复关键技术及应用”\\n获奖原因：该项目在环境科学技术上有重大创新，技术难度大，总体技术水平、主要技术经济指标达到国际先进水平，得到广泛应用，取得重大环境效益，对推动经济发展和社会进步有重大意义和作用 。\",\"isAcademician\":0,\"isPhdSu', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-17 14:12:59', 79);
