INSERT INTO `sys_oper_log` VALUES (1031, '审核申请使用专家', 2, 'com.gzzj.application.controller.EdApplicationUseExpertController.verifyEdApplicationUseExpert()', 'PUT', 1, '1101', '专家库', '/expertData/expert/expertApplication/verifyEdApplicationUseExpert', '127.0.0.1', '内网IP', '{\"activityName\":\"测试\",\"applicantNum\":2,\"applicantUnit\":\"测试\",\"beginTime\":\"2024-07-23\",\"createBy\":\"admin\",\"createTime\":\"2024-07-16 10:47:13\",\"delFlag\":\"0\",\"edApplicationEvaluationList\":[],\"edApplicationUseExpertAttachList\":[],\"edApplicationUseId\":9,\"endTime\":\"2024-08-24\",\"expertType\":\"T01\",\"fieldRequirement\":\"生态环境\",\"isConfirmationList\":\"0\",\"isSubmit\":\"1\",\"isVerify\":\"2\",\"joinType\":\"1\",\"params\":{},\"reason\":\"测试\",\"remark\":\"黄初三年，余朝京师，还济洛川。古人有言，斯水之神，名曰宓妃。感宋玉对楚王神女之事，遂作斯赋。其辞曰：\\n\\n余从京域，言归东藩。背伊阙，越轘辕，经通谷，陵景山。日既西倾，车殆马烦。尔乃税驾乎蘅皋，秣驷乎芝田，容与乎阳林，流眄乎洛川。于是精移神骇，忽焉思散。俯则未察，仰以殊观，睹一丽人，于岩之畔。乃援御者而告之曰：“尔有觌于彼者乎？彼何人斯？若此之艳也！”御者对曰：“臣闻河洛之神，名曰宓妃。然则君王之所\",\"territorialRequirement\":\"越秀区,天河区\",\"unit\":\"测试\",\"updateBy\":\"1101\",\"updateTime\":\"2024-07-16 15:43:11\",\"verifyBy\":\"1101\",\"verifyTime\":\"2024-07-17\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-17 14:56:02', 4);
